a = b''

import lzma
import base64
import json
import re

text = lzma.decompress(base64.b64decode(a)).decode()
text = re.sub('(0|[A-Z])', r'"\1"', text)
trie = json.loads(text)


import sys

def input(_type=str):
	return _type(sys.stdin.readline().strip())
def input_n(_type=str):
	return list(map(_type, input().split()))

end = '0'

table = [input_n() for _ in range(5)]
cases = set()

def travel_dfs(table, sub_trie, y, x, visited, word=''):
  if visited[y][x]:
    return

  if end in sub_trie and word != '':
    cases.add(word)

  visited[y][x] = True

  for ny, nx in [(y+1,x), (y,x+1), (y-1,x), (y,x-1), (y+1,x-1), (y-1,x+1), (y+1,x+1), (y-1,x-1)]:
    if 0<=ny<5 and 0<=nx<5:
      if table[ny][nx] in sub_trie:
        travel_dfs(table, sub_trie[table[ny][nx]], ny, nx, visited, word+table[ny][nx])
  
  visited[y][x] = False

for y in range(5):
  for x in range(5):
    visited = [[False]*5 for _ in range(5)]
    if table[y][x] in trie:
      travel_dfs(table, trie[table[y][x]], y, x, visited, table[y][x])

print(len(cases))